import Exchanges from 'src'
import UniswapV2 from 'src/platforms/evm/uniswap_v2'

describe('quickswap', () => {

  describe('basics', ()=> {
    
    it('provides basic structured data for quickswap', ()=> {
      let exchange = Exchanges.quickswap
      expect(exchange.name).toEqual('quickswap')
      expect(exchange.blockchain).toEqual('polygon')
      expect(exchange.label).toEqual('QuickSwap')
      expect(exchange.logo).toEqual('data:image/svg+xml;base64,')
      expect(exchange[blockchain].router.address).toEqual('0xa5E0829CaCEd8fFDD4De3c43696c57F7D7A678ff')
      expect(exchange[blockchain].router.api).toEqual(UniswapV2.ROUTER)
      expect(exchange[blockchain].factory.address).toEqual('0x5757371414417b8C6CAad45bAeF941aBc7d3Ab32')
      expect(exchange[blockchain].factory.api).toEqual(UniswapV2.FACTORY)
      expect(exchange[blockchain].pair.api).toEqual(UniswapV2.PAIR)
    })
  })
})
